import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import axios from 'axios';
import './CampaignDetail.css';

function CampaignDetail() {
  const { id } = useParams();
  const navigate = useNavigate();
  const [campaign, setCampaign] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchCampaign = async () => {
      try {
        setLoading(true);
        const response = await axios.get(`http://localhost:5000/api/campaigns/${id}`);
        setCampaign(response.data);
        setLoading(false);
      } catch (error) {
        console.error('Error fetching campaign:', error);
        setError('Failed to load campaign');
        setLoading(false);
      }
    };

    if (id) {
      fetchCampaign();
    }
  }, [id]);

  if (loading) {
    return (
      <div className="loading-container">
        <div className="loading-spinner"></div>
        <p>Loading campaign details...</p>
      </div>
    );
  }

  if (error) {
    return (
      <div className="error-container">
        <p>{error}</p>
        <button onClick={() => navigate('/')}>Return to Home</button>
      </div>
    );
  }

  if (!campaign) {
    return (
      <div className="error-container">
        <p>Campaign not found</p>
        <button onClick={() => navigate('/')}>Return to Home</button>
      </div>
    );
  }

  const progress = (campaign.current_amount / campaign.goal_amount) * 100;

  return (
    <div className="campaign-detail">
      <div className="campaign-header">
        <img 
          src={campaign.image_url || '/default-campaign-image.jpg'} 
          alt={campaign.title} 
          className="campaign-image"
        />
      </div>

      <div className="campaign-content">
        <div className="campaign-main">
          <h1>{campaign.title}</h1>
          <div className="campaign-story">
            <p>{campaign.description}</p>
          </div>
        </div>

        <div className="campaign-sidebar">
          <div className="fundraising-stats">
            <div className="progress-bar">
              <div 
                className="progress" 
                style={{width: `${progress}%`}}
              ></div>
            </div>

            <div className="stats">
              <div className="raised">
                <h3>${campaign.current_amount}</h3>
                <p>raised of ${campaign.goal_amount} goal</p>
              </div>
              <div className="donors">
                <h3>0</h3>
                <p>donors</p>
              </div>
            </div>

            <button className="donate-button">
              Donate Now
            </button>

            <div className="share-buttons">
              <button className="share-btn">Share</button>
              <button className="follow-btn">Follow</button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default CampaignDetail;
